  def convert_date_time_to_number_time(time)
    t = time.strftime('%H%M')
    if t[0] == '0'
      n =  t[1..(t.length-1)]
      return n.to_i
    else
      return t.to_i
    end
  end
  def convert_simple_time_to_number_time(time)
    t =  time.delete(':')
    if t[0] == '0'
      n =  t[1..(t.length-1)]
      return n.to_i
    else
      return t.to_i
    end
  end
